This application is a professional version of the free AutoSender app. It provides several features, including the ability to:

- Obtain multiple US and Canadian in-app phone numbers for automatic or manual text message sending. Each US or Canadian number can receive unlimited text messages for free;
- Send multiple attachments in one MMS;
- Use professional-level in-app embedded eCard templates for MMS and SMS;
- Create and modify automatic messaging tasks based on the content of the iOS native apps Calendar and Reminders;
- Use other features available in the AutoSender app, such as automatic SMS/MMS sending, free SMS receiving (based on private numbers), automatic SMS reply and automatic SMS forwarding (based on private numbers), group messaging, etc.

This application offers a highly flexible and low-cost solution for a variety of individual and small/medium-sized enterprise (SME) use cases:

- Subscribe to multiple US or Canadian phone numbers (private numbers) within the app. With private numbers, users can register for multiple social network accounts, such as Apple ID, Facebook, WhatsApp, WeChat, Instagram, Twitter, Gmail, etc.
- Use one or more private numbers to send SMS or MMS messages anywhere in the world as if the user is a resident of the US or Canada;
- Different phone numbers can be used to schedule marketing information for automated sending at predefined times for specific channels. Different numbers can receive reply messages from different channels, providing an effective solution for small and medium-sized enterprises with limited communication lines;
- Use automatic reply, automatic reply-to-all, and automatic forwarding on private numbers for SMS Out-of-Office, customer service, SMS-based answering machines, etc.;
- All scheduled messaging tasks are executed automatically in the cloud, making them suitable for mass messaging and telecommuting environments to automatically send text messages to employees or partners for tasks such as meeting notifications, report submissions, instructions, reminders, and more;
- Automate the sending of texts for recurring tasks, such as paying rent, submitting weekly/monthly reports, or handing in assignments;
- If you want to express your feelings with a romantic text or e-card, this is the perfect tool to schedule love texts at the most heart-touching midnight moment;
- Use this tool to automate the sending of event notifications, festival greetings, ceremony posters, and other pre-defined messages;
- Shared Lines: By logging into the same AutoSender (Pro) account on multiple iOS devices, a group of people in different locations can use the same phone number as a shared communication line with the outside world - great for decentralized offices.

We also provide the Standard Subscriptions that offer extra services and features, priced from $0.99 monthly. Subscription automatically renews unless auto-renew is turned off at least 24-hours before the end of the current period (30 days) and be charged to your iTunes account within 24-hours of the end of the current period, and identify the cost of the renewal. You can manage subscription and auto-renewal can be turned off by going to the user's Account Settings after purchase, but refunds will not be provided for any unused portion of the term.

